export function chain(iterables, out) {
	const len = iterables.length;

	if (len === 0) {
		return out;
	}

	for (let i = 0; i < len; ++i) {
		const it = iterables[i];
		const n = it.length;

		for (let j = 0; j < n; ++j) {
			out.push(it[j]);
		}
	}

	return out;
}

import {range} from '../utils/range.js';
import {pick} from '../utils/pick.js';

export function combinations(iterable, repeat, out) {
	// Combinations('ABCD', 2) --> AB AC AD BC BD CD
	// combinations(range(4), 3) --> 012 013 023 123

	const pool = iterable;
	const len = pool.length;

	if (repeat > len) {
		return out;
	}

	const indices = range(0, repeat, 1, []);

	out.push(pick(pool, indices, []));

	if (repeat === 0 || len === 0) {
		return out;
	}

	for (;;) {
		let i = repeat - 1;
		for (; i >= 0; --i) {
			if (indices[i] !== i + len - repeat) {
				break;
			}
		}

		if (i < 0) {
			return out;
		}

		++indices[i];

		for (let j = i + 1; j < repeat; ++j) {
			indices[j] = indices[j - 1] + 1;
		}

		out.push(pick(pool, indices, []));
	}
}

import {pick} from '../utils/pick.js';
import {repeat} from './repeat.js';

export function combinationswithrepetition(iterable, r, out) {
	// Combinationswithrepetition('ABC', 2) --> AA AB AC BB BC CC

	const pool = iterable;
	const len = pool.length;

	if (len === 0 && r > 0) {
		return out;
	}

	const indices = repeat(0, r, []);

	out.push(pick(pool, indices, []));

	for (;;) {
		let i = r - 1;
		let next;
		for (; i >= 0; --i) {
			if (indices[i] !== len - 1) {
				next = indices[i] + 1;
				break;
			}
		}

		if (i < 0) {
			return out;
		}

		for (; i < r; ++i) {
			indices[i] = next;
		}

		out.push(pick(pool, indices, []));
	}
}

export function compress(iterable, selector, out) {
	const j = Math.min(iterable.length, selector.length);

	for (let i = 0; i < j; ++i) {
		if (selector[i]) {
			out.push(iterable[i]);
		}
	}

	return out;
}

export function dropwhile(predicate, iterable, out) {
	const n = iterable.length;

	if (n === 0) {
		return out;
	}

	let i = 0;
	let e = iterable[i];

	while (predicate(e)) {
		++i;

		if (i === n) {
			return out;
		}

		e = iterable[i];
	}

	out.push(e);

	for (++i; i < n; ++i) {
		out.push(iterable[i]);
	}

	return out;
}

import {range} from '../utils/range.js';
import {zip} from './zip.js';

export function enumerate(iterable, out) {
	zip([range(0, iterable.length, 1, []), iterable], out);

	return out;
}

export function filter(predicate, iterable, out) {
	const len = iterable.length;

	for (let i = 0; i < len; ++i) {
		const item = iterable[i];

		if (predicate(item)) {
			out.push(item);
		}
	}

	return out;
}

export function filterfalse(predicate, iterable, out) {
	const len = iterable.length;

	for (let i = 0; i < len; ++i) {
		const item = iterable[i];

		if (!predicate(item)) {
			out.push(item);
		}
	}

	return out;
}

export function group(key, iterable, out) {
	const len = iterable.length;

	if (len === 0) {
		return out;
	}

	let i = 0;
	let item = iterable[i];
	let next = key(item);

	do {
		const curr = next;
		const items = [item];
		const tuple = [curr, items];

		++i;

		while (i < len) {
			item = iterable[i];
			next = key(item);

			if (next !== curr) {
				break;
			}

			items.push(item);
			++i;
		}

		out.push(tuple);
	} while (i < len);

	return out;
}

