export function permutations(iterable, repeat, out) {
	// Permutations('ABCD', 2) --> AB AC AD BA BC BD CA CB CD DA DB DC
	// permutations(range(3), 3) --> 012 021 102 120 201 210

	const pool = iterable;
	const len = pool.length;

	if (repeat > len) {
		return out;
	}

	const indices = range(0, len, 1, []);
	const cycles = range(len, len - repeat, -1, []);

	out.push(pick(pool, indices.slice(0, repeat), []));

	if (repeat === 0 || len === 0) {
		return out;
	}

	for (;;) {
		let i = repeat;

		while (i--) {
			--cycles[i];

			if (cycles[i] === 0) {
				const x = indices[i];

				indices.splice(i, 1);
				indices.push(x);

				cycles[i] = len - i;
			} else {
				const j = cycles[i];

				const tmp = indices[i];
				indices[i] = indices[len - j];
				indices[len - j] = tmp;

				out.push(pick(pool, indices.slice(0, repeat), []));
				break;
			}
		}

		if (i === -1) {
			return out;
		}
	}
}

export function product(iterables, repeat, out) {
	// Product(['ABCD', 'xy'], 1) --> Ax Ay Bx By Cx Cy Dx Dy
	// product([range(0, 2, 1)], 3) --> 000 001 010 011 100 101 110 111

	let a;
	let b;
	let i;
	let j;
	let k;
	let m;
	let n;
	let iterable;
	let c;
	let len;

	a = [[]];

	// Repeat k times

	for (k = 0; k < repeat; ++k) {
		// For each iterable
		// concatenate existing combinaisons
		// with every element of this iterable

		for (i = 0, m = iterables.length; i < m; ++i) {
			// B will contain the newly created combinaisons

			b = [];

			// Cache the current iterable

			iterable = iterables[i];

			// For each existing combinaison

			for (j = 0, n = a.length; j < n; ++j) {
				// For each element of the current iterable

				for (c = 0, len = iterable.length; c < len; ++c) {
					// Concatenate existing combinaison with
					// current element of the iterable

					b.push(a[j].concat(iterable[c]));
				}
			}

			// Update a for next round

			a = b;
		}
	}

	// Report output

	for (j = 0, n = a.length; j < n; ++j) {
		out.push(a[j]);
	}

	return out;
}

export function repeat(element, times, out) {
	let i;

	for (i = 0; i < times; ++i) {
		out.push(element);
	}

	return out;
}

export function reversed(iterable, out) {
	let i;

	i = iterable.length;

	while (i--) {
		out.push(iterable[i]);
	}

	return out;
}

export function sorted(f, iterable) {
	return iterable.slice(0).sort(f);
}

/**
 *
 * Maps a callable object over an array.
