export function starmap(callable, iterable, out) {
	const len = iterable.length;

	for (let i = 0; i < len; ++i) {
		out.push(callable(...iterable[i]));
	}

	return out;
}

export function takewhile(predicate, iterable, out) {
	const n = iterable.length;

	if (n === 0) {
		return out;
	}

	let i = 0;
	let e = iterable[i];

	while (predicate(e)) {
		out.push(e);

		++i;

		if (i === n) {
			return out;
		}

		e = iterable[i];
	}

	return out;
}

export function zip(iterables, out) {
	const len = iterables.length;

	if (len === 0) {
		return out;
	}

	let n = iterables[0].length;

	for (let i = 0; i < len; ++i) {
		const tmp = iterables[i].length;

		if (tmp < n) {
			n = tmp;
		}
	}

	for (let j = 0; j < n; ++j) {
		const tuple = [];

		for (let i = 0; i < len; ++i) {
			tuple.push(iterables[i][j]);
		}

		out.push(tuple);
	}

	return out;
}

import {slice} from './slice.js';

export function repr(array, left, right) {
	return JSON.stringify(slice(array, left, right));
}

export function set(a, i, v) {
	a[i] = v;
}

export function slice(array, left, right) {
	return Array.prototype.slice.call(array, left, right);
}

export function sort(f, array) {
	return Array.prototype.sort.call(array, f);
}

import {slice} from './slice.js';

export function splice(a, ai, aj, b, bi, bj) {
	if (ai === undefined) {
		ai = 0;
	} else if (ai < 0) {
		ai += a.length;
	}

	if (aj === undefined) {
		aj = ai;
	} else if (aj < 0) {
		aj += a.length;
	}

	return Array.prototype.splice.apply(
		a,
		[ai, aj - ai].concat(slice(b, bi, bj)),
	);
}

export * from './pick.js';
export * from './range.js';
export * from './tee.js';

export function pick(array, indices, out) {
	const len = indices.length;

	for (let i = 0; i < len; ++i) {
		const k = indices[i];
		out.push(array[k]);
	}

	return out;
}

export function range(start, stop, step, out) {
	if (step < 0) {
		for (; start > stop; start += step) {
			out.push(start);
		}
	} else {
		for (; start < stop; start += step) {
			out.push(start);
		}
	}

	return out;
}

export function tee(iterable, n, out) {
	const m = iterable.length;

	while (n--) {
		const deque = [];

		for (let i = 0; i < m; ++i) {
			deque.push(iterable[i]);
		}

		out.push(deque);
	}

	return out;
}

